import React from "react";
import starwars from "../../image/starwars.png";

const CardMachine = (props) => {
  return (
    <div className="body-item">
      <div className="body-title">SnowsPeeders</div>
      <div className="body-image">
        <img src={starwars} alt="" />
      </div>
      <div className="body-list" id="list1">
        <div className="item">
          <span>Max Speed</span>
          <span>{props.machine.max_atmosphering_speed}</span>
        </div>
        <div className="item">
          {" "}
          <span>Credit</span>
          <span>{props.machine.cost_in_credits}</span>
        </div>
        <div className="item">
          {" "}
          <span>Passengers</span>
          <span>{props.machine.passengers}</span>
        </div>
        <div className="item">
          {" "}
          <span>Film Appearances</span>
          <span>{props.machine.films?.length}</span>
        </div>
      </div>
    </div>
  );
};

export default CardMachine;
